import { Switch, Router } from 'react-router-dom'
import '../App.css';
import Footer from './Footer'
import NavBar from './NavBar'
import Header from './Header';
import HomePage from './HomePage';
import NewArticleForm from './NewArticleForm';

function App() {
  return (
    <div className="App">
      <Header/>
      <NavBar/>
      <Switch>
        <Router exact path="/">
          <HomePage/>
        </Router>
        <Router path="/form">
          <NewArticleForm/>
        </Router>
      </Switch>
      <Footer/>
    </div>
  );
}

export default App;
